import React, {Component} from 'react';

const rightsidebar = (props) =>{
    return(
        <div class="rightcolumn">

    <div className="searchForm">
        <form>
          <input
            placeholder="Search for..."value="search"/>
            <button type="submit" value="Enter"><i class="fa fa-search">Enter</i></button>

        </form>
        </div>

        <div class="card">
      <h2>gallery </h2> 
      <img src={props.name} alt="image1"/><img src={props.name} alt="image2"/>
      <img src={props.name} alt="image3"/><img src={props.name} alt="image4"/>
      <img src={props.name}/><img src={props.name}/>     </div>

    <div class="card">
      <h3>You might like</h3>
      <div class="fakeimg"><p><img src={props.image}/>     {props.name}<br/>{props.tweetid}</p></div>
      <div class="fakeimg"><p>Image</p></div>
      <div class="fakeimg"><p>Image</p></div>


    </div>
    <div class="card">
      <h3>Trends for you</h3>
      <p>Some text..</p>
    </div>
  </div>
    );
}
export default rightsidebar


